import React, { Component } from 'react';
import { Navbar, Container, Nav } from 'react-bootstrap'
import './style.css';

export default class NavbarMenu extends Component {
    render() {
        return (
            <div>
                <Navbar collapseOnSelect expand="lg"  className='menu' text->
                    <Container className='link'>
                        <Navbar.Brand href="#home" >Agência de Viagem</Navbar.Brand>
                        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                        <Navbar.Collapse id="responsive-navbar-nav">
                            <Nav className="me-auto">
                                <Nav.Link className={'teste'} href="#Inicio" >Início</Nav.Link>
                                <Nav.Link href="Cadastrar">Cadastrar</Nav.Link>
                                <Nav.Link href="Promoções">Promoções</Nav.Link>
                                <Nav.Link href="Contato">Contato</Nav.Link>
                            </Nav>
                        </Navbar.Collapse>
                    </Container>
                </Navbar>
            </div>
        );
    }
}
